'''Captain Ninto''' is a drunk, off-duty [[Gnome glider]] pilot that can be found inside the dwarven [[White Wolf Tunnel|passage]] under the [[White Wolf Mountain]] (Sindarpos). He can only be reached after the player has completed the [[Fishing Contest]] [[quest]].

He is a hard customer of the [[Gnome Restaurant]] [[minigame]] and is one of the two customers that can reward the [[Gnome scarf]] and [[Gnome goggles]], the other being [[Captain Daerkin]].

